import React, { useRef, useState } from 'react';
import { motion } from 'framer-motion';
import emailjs from '@emailjs/browser';

const ContactModal = ({ isOpen, onClose }) => {
  const form = useRef();
  const [status, setStatus] = useState("Send Inquiry");

  if (!isOpen) return null;

  const handleContactSubmit = (e) => {
    e.preventDefault();
    setStatus("Sending...");

    emailjs.sendForm(
      "service_dr7gwfd", 
      "template_qnqsba6", 
      form.current, 
      "ckvfCOskvrB9_LAtF"
    )
    .then(() => {
      setStatus("Message Sent!");
      setTimeout(() => {
        setStatus("Send Inquiry");
        onClose();
      }, 2000);
    }, (error) => {
      console.error("FAILED...", error);
      setStatus("Error: Check Console");
    });
  };

  return (
    <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} style={styles.overlay} onClick={onClose}>
      <motion.div initial={{ y: 50 }} animate={{ y: 0 }} style={styles.modal} onClick={(e) => e.stopPropagation()}>
        <button onClick={onClose} style={styles.closeBtn}>Ã—</button>
        <h2 style={styles.title}>Let's Build Something <span style={{color: '#2ecc71'}}>Great</span></h2>
        
        <form ref={form} style={styles.form} onSubmit={handleContactSubmit}>
          <div style={styles.row}>
            {/* The name="from_name" connects to {{from_name}} in your EmailJS settings */}
            <div style={styles.inputGroup}>
              <label style={styles.label}>Full Name</label>
              <input name="from_name" type="text" placeholder="Hamza" style={styles.input} required />
            </div>
            {/* The name="from_email" connects to {{from_email}} in your EmailJS settings */}
            <div style={styles.inputGroup}>
              <label style={styles.label}>Email Address</label>
              <input name="from_email" type="email" placeholder="rajwara.96@gmail.com" style={styles.input} required />
            </div>
          </div>
          
          <div style={styles.inputGroup}>
            <label style={styles.label}>Project Type</label>
            <select name="service_type" style={styles.input}>
              <option value="Web Development">Web Development</option>
              <option value="Mobile App">Mobile App</option>
            </select>
          </div>

          <div style={styles.inputGroup}>
            <label style={styles.label}>Message</label>
            <textarea name="message" placeholder="Describe your project..." style={{...styles.input, height: '100px'}} required />
          </div>

          <button type="submit" style={styles.submitBtn}>{status}</button>
        </form>
      </motion.div>
    </motion.div>
  );
};

const styles = {
  overlay: { position: 'fixed', inset: 0, background: 'rgba(0,0,0,0.9)', zIndex: 2000, display: 'flex', justifyContent: 'center', alignItems: 'center' },
  modal: { background: '#111', width: '95%', maxWidth: '600px', borderRadius: '30px', padding: '40px', border: '1px solid #222', position: 'relative' },
  closeBtn: { position: 'absolute', top: '15px', right: '20px', background: 'none', border: 'none', color: '#fff', fontSize: '2rem', cursor: 'pointer' },
  title: { fontSize: '2rem', color: '#fff', textAlign: 'center', marginBottom: '30px' },
  form: { display: 'flex', flexDirection: 'column', gap: '15px' },
  row: { display: 'flex', gap: '15px', flexWrap: 'wrap' },
  inputGroup: { flex: 1, display: 'flex', flexDirection: 'column', gap: '5px' },
  label: { color: '#2ecc71', fontSize: '0.8rem', fontWeight: 'bold' },
  input: { background: '#1a1a1a', border: '1px solid #333', padding: '15px', borderRadius: '10px', color: '#fff', outline: 'none' },
  submitBtn: { background: '#2ecc71', color: '#000', padding: '18px', borderRadius: '12px', fontWeight: 'bold', border: 'none', cursor: 'pointer', marginTop: '10px' }
};

export default ContactModal;
